import Card from '../Card/Card';
import style from "./Cards.module.css"

const Cards = () => {


   return (
    <div className={style.cards}>
      {dogs.map((dog)=>{
        return (
        <Card
        image={dog.image}
        Nombre={dog.name}
        Temperamento={dog.temperament}
        Peso={dog.weight}
        />)
      })}        
    </div>
)}


export default Cards;
